import React, { useState } from 'react'
import './MyCard2.css'

export default function MyCard2({title, img}) {
    const [clicked, setClicked] = useState(false);

    return (
        <div className="container" style={{ backgroundImage: `url(${img})` }}>
            <div className="title">
                <p className="title__text" onClick={() => setClicked(!clicked)}>{title}</p>
            </div>
        </div>
    )
}
